// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import RootsPage from './pages/RootsPage';  // Add this import
import NodePage from './pages/NodePage';
import CreateTopic from './components/CreateTopic';
import CreateChild from './components/NodePageComponents/CreateChild';
import UserProfilePage from './pages/UserProfilePage';
import Welcome from './pages/TextBasedPages/Welcome';
import Help from './pages/TextBasedPages/Help';
import About from './pages/TextBasedPages/About';
import Settings from './pages/Settings';

import PrivateRoute from './components/LoginSignupComponents/PrivateRoute';
import LandingPage from './pages/LoginSignupPages/LandingPage';
//import LoginPage from './pages/LoginSignupPages/LoginPage';
//import SignupPage from './pages/LoginSignupPages/SignupPage';
import DashboardPage from './pages/LoginSignupPages/DashboardPage';
import AuthPage from './pages/LoginSignupPages/AuthPage';
import HomePage from './HomeCode/HomePage';

function App() {
  return (
    <Router>
      <div className="container mt-4">
        <Routes>
          <Route path="/node/:id" element={<NodePage />} />

          <Route path="/" element={<RootsPage />} /> 

          <Route path="/topics/new" element={<CreateTopic />} />
          <Route path="/node/:id/newnode" element={<CreateChild />} />

          <Route path="/profile" element={<UserProfilePage />} />
          <Route path="/settings" element={<Settings />} />
          <Route path="/about" element={<About />} />
          <Route path="/help" element={<Help />} />
          <Route path="/welcome" element={<Welcome />} />

          <Route path="/loginSignupPage" element={<LandingPage />} />
          <Route path="/login" element={<AuthPage />} />
          <Route path="/signup" element={<AuthPage />} />
          <Route
            path="/dashboard"
            element={
              <PrivateRoute>
                <DashboardPage />
              </PrivateRoute>
            }
          />
          <Route path = "HomePage" element ={<HomePage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
